import React from "react";
import Product from "../components/Product";
import { useSelector } from "react-redux";

const Products = () => {
  const items = useSelector((state) => state.productSlice.items);
  return (
    <div className="wrapper">
      {items.map(() => (
        <Product />
      ))}
    </div>
  );
};

export default Products;
